import React from "react";
import JobPostForm from "./JobPostForm";
import JobPostList from "./JobPostList";

const AdminDashboard = () => {
    return (
        <div>
            <h1>Admin Dashboard</h1>
            <JobPostForm />
            <JobPostList />
        </div>
    );
};

export default AdminDashboard;
